import React  from "react"

const Table = (props) => {
  const title  = props.tableName;
  const header = Object.keys(props.details[title]).map(values => <th> {values}</th>);
  return (
    <div>
        <table>
            <tr>
            <th># </th>
            {
                header
            }
            </tr>
        </table>
    </div>
)

} 

export default Table;
